ОКУД 0420415. Раздел 1. Подраздел 1.1. Если в подразделе 1.1 раздела 1 формы отчетности 0420415 заполнен хотя бы один из показателей "Количество ценных бумаг, учитываемых регистратором на лицевых счетах номинального держателя в реестре / депозитарием на счетах депо номинального держателя / счетах депо иностранного номинального держателя, по каждому номинальному держателю", "Номер счета депо (лицевого счета) номинального держателя, открытого в вышестоящем депозитарии (регистраторе)", "Номер счета депо (лицевого счета) номинального держателя", "Признак организации (вышестоящего депозитария, регистратора)", "Признак номинального держателя" и не заполнены значения показателей «Первоначальная сумма основного обязательства по закладной, обеспеченного ипотекой», «Код валюты основного обязательства по закладной, обеспеченного ипотекой», то в отчетности по форме 0420459:
в подразделе 1.1 раздела 1 по соответствующему АП ГАП «Идентификатор ценной бумаги» показатель "Тип ценной бумаги (вид финансового инструмента)" должен принимать одно из значений: "BON1", "BON2", "BON3", "BON4", "BON5", "BON6", "BON7", "DS1", "DS2", "SS1", "SS2", "SHS1", "SHS2", "SHS3", "SHS4", "SHS5", "SHS6", "SHS7", "SHS8", "SHS9", "SHS10", "SN1", "SN2", "SN3", "SN4", "DR1", "DR2", "CON", "WTS", "OPN", "KSU", "ISU", "OTHER";
либо в подразделе 1.2 раздела 1 по соответствующему АП ГАП «Идентификатор цифрового свидетельства» показатель «Тип ценной бумаги (цифрового свидетельства)» должен принимать одно из значений: «DIGS(UDR1)», «DIGS(UDR2)», «DIGS(UDR3)».
